def is_woodall(x: int) -> bool:
    n = 1
    while True:
        woodall_number = n * (2 ** n) - 1
        if woodall_number == x:
            return True
        elif woodall_number > x:
            return False
        n += 1

# Example usage:
print(is_woodall(7))  # True, because 7 is 2*2^2 - 1
print(is_woodall(15)) # False
print(is_woodall(31)) # True, because 31 is 3*2^3 - 1

from typing import List, Optional

def find_first_duplicate(nums: List[int]) -> Optional[int]:
    seen = set()
    for num in nums:
        if num in seen:
            return num
        seen.add(num)
    return None  # Return None if no duplicate is found

def find_product(arr: list, n: int) -> int:
    # Create a dictionary to store the frequency of each element
    frequency = {}
    for num in arr:
        if num in frequency:
            frequency[num] += 1
        else:
            frequency[num] = 1

    # Calculate the product of non-repeated elements
    product = 1
    for num, count in frequency.items():
        if count == 1:
            product *= num

    return product

