def decimal_to_binary(N: int) -> str:
    if N == 0:
        return "0"
    binary = ""
    while N > 0:
        binary = str(N % 2) + binary
        N = N // 2
    return binary

def find_rect_num(n: int) -> int:
    if n < 0:
        raise ValueError("Invalid input: n must be a non-negative integer")
    return n * (n + 1)

