result = get_gcd(arr)
print(f"The GCD of the array elements {arr} is {result}")

from typing import List, Tuple, Optional

def min_length_list(lists: List[List]) -> Optional[Tuple[int, List]]:
    if not lists:
        return None
    min_list = min(lists, key=lambda x: len(x))
    return (len(min_list), min_list)

